import React from 'react';

const Sidebar = () => {
    return (
        <div>
            <img src="../assets/autograph.jpg" alt="photo" className="sidebarPhoto" />
            <div className="sidebarName">Steven <span>Schaab</span></div>
            <div className="sidebarItem sidebarTitle">Web Developer</div>
            <a href="">
                <div className="sidebarItem">
                    <img src="" alt="" className="sidebarIcon" />Download Resume
                </div>
            </a>
            <div className="contact"></div>
        </div>
    )
}

export default Sidebar;
